import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import { styled } from '@mui/material/styles';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
// import '../CSS/EmployeeSchedule.css';

function getNumberRows(obj) {
    let day, max_n=0, length;
    for (day in obj) {
        length = Object.keys(obj[day][0]).length;
        if (max_n < length)
            max_n = length;
    }
    return max_n;
}

function getTime_i(obj, day, i) {
    let html = [];
    // console.log(obj[day]);
    obj[day].forEach(function(time) {
        if (Object.keys(time).length > i) {
            html.push(
                <StyledTableCell className={"table"} component="th" scope="row">{Object.keys(time)[i]}</StyledTableCell>
            );
            html.push(
                <StyledTableCell aling="center">{Object.values(time)[i].description}</StyledTableCell>
            );
            html.push(
                <StyledTableCell aling="center">{Object.values(time)[i].duration}</StyledTableCell>
            );
        }
    })
    return html;
}

function loopDay(obj, i) {
    let day;
    let html = [];
    let week = ["mon", "tue", "wed", "thu", "fri"];
    var dispara = false;

    if(!dispara) {
        console.log(obj['fri'][0]==null);
        dispara = true;
    }
    week.forEach(function(day) {
        if (obj[day]) {
        // if (Object.values(obj[day][0])[i]!=null) {
                html.push (
                getTime_i(obj, day, i)
            )
        }
        else {
            html.push(
                <StyledTableCell align="center">-</StyledTableCell>
            );
            html.push(
                <StyledTableCell align="center">-</StyledTableCell>
            );
            html.push(
                <StyledTableCell align="center">-</StyledTableCell>
            );
        }
    })
    return html;
}

function loopRow(obj) {
    let day, i;
    let html = [];
    for (i=0;i<getNumberRows(obj);i++) {
        html.push(<StyledTableRow
            // key={Object.keys(item[0])[0]}
            sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
        >
            {loopDay(obj, i)}
        </StyledTableRow>);
    }
    return html;
}

const StyledTableCellLastChild = {
    border: "1px solid gray",
};

const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
        backgroundColor: theme.palette.common.black,
        color: theme.palette.common.white,
        fontSize: 14,
        padding: 5,
    },
    [`&.${tableCellClasses.body}`]: {
        fontSize: 13,
    },
    '&:last-child td, &:last-child th': {
        border: "1px solid gray",
        backgroundColor: theme.palette.common.black,
    },
    '&:tr:nth-child(odd)':{
        border: "1px solid gray",
        backgroundColor: theme.palette.common.black,
    },
    padding: 5,
    border: "1px solid gray",
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.common.white,
    },
    // hide last border
    '&:last-child td, &:last-child th': {
      border: "1px solid gray",
    },
  }));

export default function EmployeeSchedule(props) {
    return (
        <div>
        <TableContainer component={Paper}>
            <Table sx={{ minWidth: 650 }} size="small" aria-label="a dense table">
                <TableHead>
                    <TableRow>
                        <StyledTableCell align="center" colSpan={3}>Monday</StyledTableCell>
                        <StyledTableCell align="center" colSpan={3}>Tuesday</StyledTableCell>
                        <StyledTableCell align="center" colSpan={3}>Wednesday</StyledTableCell>
                        <StyledTableCell align="center" colSpan={3}>Thursday</StyledTableCell>
                        <StyledTableCell align="center" colSpan={3}>Friday</StyledTableCell>
                    </TableRow>
                    <TableRow>
                        <StyledTableCell align="center">Time</StyledTableCell>
                        <StyledTableCell align="center">Description</StyledTableCell>
                        <StyledTableCell align="center">Duration</StyledTableCell>
                        <StyledTableCell align="center">Time</StyledTableCell>
                        <StyledTableCell align="center">Description</StyledTableCell>
                        <StyledTableCell align="center">Duration</StyledTableCell>
                        <StyledTableCell align="center">Time</StyledTableCell>
                        <StyledTableCell align="center">Description</StyledTableCell>
                        <StyledTableCell align="center">Duration</StyledTableCell>
                        <StyledTableCell align="center">Time</StyledTableCell>
                        <StyledTableCell align="center">Description</StyledTableCell>
                        <StyledTableCell align="center">Duration</StyledTableCell>
                        <StyledTableCell align="center">Time</StyledTableCell>
                        <StyledTableCell align="center">Description</StyledTableCell>
                        <StyledTableCell align="center">Duration</StyledTableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {loopRow(props.schedule)}
                </TableBody>
            </Table>
        </TableContainer>
        </div>
    );
}
